import React from "react"
import postlist from './posts.json'
import { makeStyles } from '@material-ui/styles'
import { Box, CardContent, Card } from '@material-ui/core'

const PostList = () => {

    const useStyles = makeStyles({
        container: {
        },
        cardPost: {
          backgroundColor: "#ffffff",
          marginBottom: "50px",
          marginleft: "0px",
          marginBottom: "50px",
          borderRadius: '2px',
          leftpadding: "20px"
        },
        headerText: {
          fontWeight: "bolder"
        },
        headerLink: {
          textDecoration: "none",
          color: "black"
        },
      })
    
    const classes = useStyles();

    return (
        <div className="postlist">
        {postlist.length &&
        postlist.map((post, i) => {
            return (
                <Box>
                    <CardContent>
                        <Card className={classes.cardPost}>
                    <h2>{post.title}</h2>
                    <p>{post.content}</p>
                        </Card>
                    </CardContent>
                </Box>
            )
        })}
        </div>
    )
}

export {PostList}
